        <script>
        document.addEventListener("DOMContentLoaded", function() {
            // получаем объект карты из глобальной переменной folium
            var MAP = window["map_16c0820d5f77b066960be04f539bd4a7"];

            var STREETS = [];

            function metersDistance(a, b) {
                // приближённое расстояние (в метрах) между координатами [lat,lon]
                var dy = (a[0] - b[0]) * 111000.0;
                var dx = (a[1] - b[1]) * (111000.0 * Math.cos((a[0] + b[0]) * Math.PI / 360.0));
                return Math.sqrt(dx*dx + dy*dy);
            }

            function findNearestStreet(userLatLng) {
                var best = null;
                var bestDist = Infinity;
                var bestPoint = null;

                STREETS.forEach(function(st) {
                    if (!st.coords || st.coords.length === 0) return;

                    // искать минимальное расстояние до каждого вершинного сегмента (здесь: до вершин)
                    for (var i = 0; i < st.coords.length; i++) {
                        var p = st.coords[i];
                        var d = metersDistance(userLatLng, p);
                        if (d < bestDist) {
                            bestDist = d;
                            best = st;
                            bestPoint = p;
                        }
                    }
                });

                return { street: best, distance: bestDist, point: bestPoint };
            }

            function highlightStreetAndShowInfo(streetObj, distMeters) {
                if (!streetObj) return;
                // рисуем выделение линии (синяя толстая)
                var poly = L.polyline(streetObj.coords, {
                    color: '#0044ff',
                    weight: 12,
                    opacity: 0.6
                }).addTo(MAP);

                // ставим popup в средней точке улицы
                var mid = streetObj.coords[Math.floor(streetObj.coords.length / 2)] || streetObj.coords[0];
                var text = "Ближайшая улица: <b>" + (streetObj.name || '-') + "</b><br>Расстояние: " + distMeters.toFixed(1) + " м";
                L.popup().setLatLng(mid).setContent(text).openOn(MAP);

                // плавный переход
                MAP.flyTo(mid, 16);
            }

            function onShowNearestClicked() {
                if (!navigator.geolocation) {
                    alert("Геолокация не поддерживается этим браузером.");
                    return;
                }

                navigator.geolocation.getCurrentPosition(function(pos) {
                    var user = [pos.coords.latitude, pos.coords.longitude];
                    var res = findNearestStreet(user);
                    if (!res.street) {
                        alert("Не удалось найти ближайшую улицу на карте.");
                        return;
                    }
                    // отмечаем пользователя
                    L.marker(user).addTo(MAP).bindPopup("Вы здесь").openPopup();
                    highlightStreetAndShowInfo(res.street, res.distance);
                }, function(err) {
                    alert("Ошибка геопозиции: " + err.message);
                }, { enableHighAccuracy: true, maximumAge: 0 });
            }

            // создаём кнопку UI
            var btn = document.createElement("button");
            btn.textContent = "Показать ближайшую улицу ко мне";
            btn.style.position = "absolute";
            btn.style.top = "10px";
            btn.style.left = "50%";
            btn.style.transform = "translateX(-50%)";
            btn.style.padding = "8px 12px";
            btn.style.background = "white";
            btn.style.border = "1px solid #888";
            btn.style.borderRadius = "6px";
            btn.style.zIndex = 99999;
            btn.onclick = onShowNearestClicked;
            document.body.appendChild(btn);
        });
        </script>
